import React from "react";  
import Navigation from "./Components/navigation";
import Section from './Components/section'

class App extends React.Component{
  clicking = ()=>{
    window.location.href="https://www.wazirx.com"
  }

  first2 = ()=>{
    window.location.href="https://www.wazirx.com"
  }

  second2 = ()=>{
    window.location.href="https://www.wazirx.com"
  }

   third2= ()=>{
    window.location.href="https://www.wazirx.com"
  }

   fourth2= ()=>{
    window.location.href="https://www.wazirx.com"
  }


  render(){
    return(
      <div>
        <Navigation click2={this.clicking} first={this.first2} first={this.first2} first={this.first2} first={this.fourth2} />
        <Section />
      </div>
    )
  }
}

export default App;
